       .then((res) => res.json())
       .then((json) => {
       
           return json
       })
    }
    return (
        <noteContext.Provider value={myNewState()} >
            {props.children}
        </noteContext.Provider>
    )
}
const FileState = (props) => {
    const states = {
        "name": "aayu",
